import React, { useState } from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  Card,
  CardContent,
  Grid,
  Autocomplete,
  Chip,
  Rating,
  IconButton,
  InputAdornment,
  Skeleton,
  useTheme,
  useMediaQuery
} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import FilterListIcon from '@mui/icons-material/FilterList';
import StarIcon from '@mui/icons-material/Star';
import LocalHospitalIcon from '@mui/icons-material/LocalHospital';
import { useHistory } from 'react-router-dom';

const setores = [
  'Odontologia',
  'Fisioterapia',
  'Psicologia',
  'Nutrição',
  'Dermatologia',
  'Oftalmologia',
  'Cardiologia',
  'Ortopedia',
  'Pediatria',
  'Ginecologia'
];

const tratamentos = {
  'Odontologia': ['Limpeza', 'Canal', 'Extração', 'Clareamento', 'Ortodontia'],
  'Fisioterapia': ['Ortopédica', 'Neurológica', 'Respiratória', 'Esportiva'],
  'Psicologia': ['Terapia Individual', 'Terapia de Casal', 'Terapia Infantil'],
  'Nutrição': ['Reeducação Alimentar', 'Nutrição Esportiva', 'Nutrição Clínica'],
  'Dermatologia': ['Consulta', 'Procedimentos Estéticos', 'Tratamentos a Laser'],
  'Oftalmologia': ['Consulta', 'Exames', 'Cirurgias'],
  'Cardiologia': ['Consulta', 'Check-up', 'Exames'],
  'Ortopedia': ['Consulta', 'Fisioterapia', 'Cirurgia'],
  'Pediatria': ['Consulta', 'Vacinação', 'Check-up'],
  'Ginecologia': ['Consulta', 'Exames', 'Procedimentos']
};

export default function BuscarClinicas() {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));
  const history = useHistory();
  
  const [loading, setLoading] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [location, setLocation] = useState('');
  const [selectedSetor, setSelectedSetor] = useState(null);
  const [selectedTratamentos, setSelectedTratamentos] = useState([]);
  const [clinicas, setClinicas] = useState([]);

  const handleSearch = async () => {
    setLoading(true);
    // Simular chamada à API
    setTimeout(() => {
      setClinicas([
        {
          id: 1,
          nome: 'Clínica Saúde Total',
          endereco: 'Rua das Flores, 123',
          setor: 'Odontologia',
          tratamentos: ['Limpeza', 'Canal', 'Extração'],
          rating: 4.8,
          reviews: 128,
          imagem: 'https://source.unsplash.com/400x300/?clinic,dental'
        },
        {
          id: 2,
          nome: 'Centro Médico Bem Estar',
          endereco: 'Av. Principal, 456',
          setor: 'Fisioterapia',
          tratamentos: ['Ortopédica', 'Neurológica'],
          rating: 4.5,
          reviews: 96,
          imagem: 'https://source.unsplash.com/400x300/?clinic,physiotherapy'
        },
        // Adicione mais clínicas mock aqui
      ]);
      setLoading(false);
    }, 1500);
  };

  return (
    <Box sx={{ 
      minHeight: '100vh',
      background: 'radial-gradient(circle at 50% 30%, #23272f 60%, #181a20 100%)',
      position: 'relative',
      overflow: 'hidden',
      pb: 8
    }}>
      {/* Efeito de gradiente animado */}
      <Box sx={{
        position: 'absolute',
        top: '-50%',
        left: '-50%',
        width: '200%',
        height: '200%',
        background: 'radial-gradient(circle at center, rgba(33, 150, 243, 0.1) 0%, transparent 50%)',
        animation: 'rotate 30s linear infinite',
        '@keyframes rotate': {
          '0%': { transform: 'rotate(0deg)' },
          '100%': { transform: 'rotate(360deg)' }
        },
        zIndex: 0
      }} />

      {/* Header de Busca */}
      <Box sx={{
        position: 'sticky',
        top: 0,
        zIndex: 10,
        backdropFilter: 'blur(10px)',
        background: 'rgba(13, 25, 41, 0.8)',
        borderBottom: '1px solid rgba(255, 255, 255, 0.1)',
        py: 3,
        px: { xs: 2, md: 6 }
      }}>
        <Box sx={{ maxWidth: 1200, mx: 'auto' }}>
          <Typography variant="h4" fontWeight={800} color="#fff" mb={3}>
            Buscar Clínicas
          </Typography>

          <Grid container spacing={2} alignItems="flex-start">
            <Grid item xs={12} md={4}>
              <TextField
                fullWidth
                variant="outlined"
                placeholder="Buscar por nome da clínica..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">
                      <SearchIcon sx={{ color: 'rgba(255, 255, 255, 0.7)' }} />
                    </InputAdornment>
                  )
                }}
              />
            </Grid>

            <Grid item xs={12} md={3}>
              <TextField
                fullWidth
                variant="outlined"
                placeholder="Localização..."
                value={location}
                onChange={(e) => setLocation(e.target.value)}
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">
                      <LocationOnIcon sx={{ color: 'rgba(255, 255, 255, 0.7)' }} />
                    </InputAdornment>
                  )
                }}
              />
            </Grid>

            <Grid item xs={12} md={3}>
              <Autocomplete
                fullWidth
                options={setores}
                value={selectedSetor}
                onChange={(event, newValue) => {
                  setSelectedSetor(newValue);
                  setSelectedTratamentos([]);
                }}
                renderInput={(params) => (
                  <TextField
                    {...params}
                    variant="outlined"
                    placeholder="Selecione o setor"
                  />
                )}
              />
            </Grid>

            <Grid item xs={12} md={2}>
              <Button
                fullWidth
                variant="contained"
                size="large"
                onClick={handleSearch}
                sx={{
                  py: 1.8,
                  background: 'linear-gradient(135deg, #2196f3 0%, #1976d2 100%)',
                  '&:hover': {
                    background: 'linear-gradient(135deg, #64b5f6 0%, #2196f3 100%)'
                  }
                }}
              >
                Buscar
              </Button>
            </Grid>

            {selectedSetor && (
              <Grid item xs={12}>
                <Autocomplete
                  multiple
                  options={tratamentos[selectedSetor] || []}
                  value={selectedTratamentos}
                  onChange={(event, newValue) => setSelectedTratamentos(newValue)}
                  renderTags={(value, getTagProps) =>
                    value.map((option, index) => (
                      <Chip
                        label={option}
                        {...getTagProps({ index })}
                        sx={{
                          background: 'rgba(33, 150, 243, 0.2)',
                          borderColor: '#2196f3',
                          color: '#fff'
                        }}
                      />
                    ))
                  }
                  renderInput={(params) => (
                    <TextField
                      {...params}
                      variant="outlined"
                      placeholder="Selecione os tratamentos"
                    />
                  )}
                />
              </Grid>
            )}
          </Grid>
        </Box>
      </Box>

      {/* Resultados */}
      <Box sx={{ maxWidth: 1200, mx: 'auto', px: { xs: 2, md: 6 }, py: 4, position: 'relative', zIndex: 1 }}>
        <Grid container spacing={3}>
          {loading ? (
            // Skeletons para loading
            Array.from(new Array(6)).map((_, index) => (
              <Grid item xs={12} sm={6} md={4} key={index}>
                <Card sx={{ height: '100%', background: 'rgba(13, 25, 41, 0.95)' }}>
                  <Skeleton variant="rectangular" height={200} />
                  <CardContent>
                    <Skeleton variant="text" height={32} width="80%" />
                    <Skeleton variant="text" height={24} width="60%" />
                    <Skeleton variant="text" height={24} width="40%" />
                    <Box sx={{ mt: 2 }}>
                      <Skeleton variant="rectangular" height={36} />
                    </Box>
                  </CardContent>
                </Card>
              </Grid>
            ))
          ) : clinicas.length > 0 ? (
            clinicas.map((clinica) => (
              <Grid item xs={12} sm={6} md={4} key={clinica.id}>
                <Card sx={{ 
                  height: '100%',
                  background: 'linear-gradient(135deg, rgba(13, 25, 41, 0.95) 0%, rgba(8, 19, 32, 0.95) 100%)',
                  backdropFilter: 'blur(10px)',
                  borderRadius: 4,
                  border: '1px solid rgba(255, 255, 255, 0.1)',
                  transition: 'all 0.3s ease-in-out',
                  '&:hover': {
                    transform: 'translateY(-8px)',
                    boxShadow: '0 12px 24px rgba(0,0,0,0.3)'
                  }
                }}>
                  <Box sx={{ 
                    position: 'relative',
                    paddingTop: '75%',
                    backgroundImage: `url(${clinica.imagem})`,
                    backgroundSize: 'cover',
                    backgroundPosition: 'center',
                    borderTopLeftRadius: 4,
                    borderTopRightRadius: 4
                  }} />
                  <CardContent sx={{ p: 3 }}>
                    <Typography variant="h6" fontWeight={700} color="#fff" gutterBottom>
                      {clinica.nome}
                    </Typography>
                    <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                      <LocationOnIcon sx={{ color: '#64b5f6', mr: 1, fontSize: 20 }} />
                      <Typography variant="body2" color="#b0b8c1">
                        {clinica.endereco}
                      </Typography>
                    </Box>
                    <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                      <Rating
                        value={clinica.rating}
                        readOnly
                        precision={0.1}
                        size="small"
                        sx={{ color: '#f5b014' }}
                      />
                      <Typography variant="body2" color="#b0b8c1" sx={{ ml: 1 }}>
                        ({clinica.reviews} avaliações)
                      </Typography>
                    </Box>
                    <Box sx={{ mb: 2 }}>
                      <Chip
                        icon={<LocalHospitalIcon />}
                        label={clinica.setor}
                        sx={{
                          background: 'rgba(33, 150, 243, 0.2)',
                          borderColor: '#2196f3',
                          color: '#fff',
                          mr: 1,
                          mb: 1
                        }}
                      />
                      {clinica.tratamentos.map((tratamento, index) => (
                        <Chip
                          key={index}
                          label={tratamento}
                          size="small"
                          sx={{
                            background: 'rgba(255, 255, 255, 0.1)',
                            color: '#fff',
                            mr: 1,
                            mb: 1
                          }}
                        />
                      ))}
                    </Box>
                    <Button
                      variant="contained"
                      fullWidth
                      sx={{
                        background: 'linear-gradient(135deg, #2196f3 0%, #1976d2 100%)',
                        '&:hover': {
                          background: 'linear-gradient(135deg, #64b5f6 0%, #2196f3 100%)'
                        }
                      }}
                    >
                      Ver Detalhes
                    </Button>
                  </CardContent>
                </Card>
              </Grid>
            ))
          ) : (
            <Grid item xs={12}>
              <Box sx={{ 
                textAlign: 'center',
                py: 8,
                background: 'rgba(13, 25, 41, 0.95)',
                borderRadius: 4,
                border: '1px solid rgba(255, 255, 255, 0.1)'
              }}>
                <SearchIcon sx={{ fontSize: 64, color: '#64b5f6', mb: 2 }} />
                <Typography variant="h5" fontWeight={700} color="#fff" gutterBottom>
                  Nenhuma clínica encontrada
                </Typography>
                <Typography color="#b0b8c1">
                  Tente ajustar seus filtros de busca
                </Typography>
              </Box>
            </Grid>
          )}
        </Grid>
      </Box>
    </Box>
  );
}
